// MainContent.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

const MainContent = () => {
  const navigate = useNavigate();

  const goToProfile = () => navigate('/profile');
  const goToGoLive = () => navigate('/go-live');
  const goToWatchIncidents = () => navigate('/watch-incidents');

  return (
    <div className="p-6 space-y-4">
      {/* Card for Go Live */}
      <div className="card" onClick={goToGoLive}>
        {/* Card content for Go Live */}
      </div>

      {/* Card for Update Profile */}
      <div className="card" onClick={goToProfile}>
        {/* Card content for Update Profile */}
      </div>

      {/* Card for Watch Previous Incidents */}
      <div className="card" onClick={goToWatchIncidents}>
        {/* Card content for Watch Previous Incidents */}
      </div>

      {/* Add more cards as needed */}
    </div>
  );
};

export default MainContent;
